import React from 'react';
import ReactDOM from 'react-dom';
import { Provider } from 'react-redux';
import { PersistGate } from 'redux-persist/integration/react';
import App from './App';

ReactDOM.render(
  <Provider store = {store}>
    <PersistGate>
    <App />
    </PersistGate>
   
  </Provider>,
  document.getElementById('root')
);
